function About() {
  return (
    <div>
      <h1>Welcome to the About Page!</h1>
      <p>Our web application was created to help pets find a loving home.</p>
      <p>Our goal is to create useful tools and resources to help you achieve your goals.</p>
      <p>If you have any questions, feel free to <a href="#contact">contact us</a>.</p>
    </div>
  );
}

export default About;
